import { useUser } from "../lib/hooks";
import Layout from "./layout";

const PremiumContent = () => {
  const user = useUser();

  return (
    <Layout>
      {user ? (
        <div>
          Now that the user has created an account and subscribed to a recurring
          payment, they'll be able to see all of your PREMIUM newsletters here!
        </div>
      ) : (
        <div>All of your FREE newsletters can be displayed here.</div>
      )}
      <style>{`
        div {
          font-size: 17px;
        }
      `}</style>
    </Layout>
  );
};

export default PremiumContent;
